import React from "react";
import Item from "./Items";
const usersNames = ["Winnie", "Bob", "Thomas", "George"];

export default function List({ blocktext, id }) {
  return (
    <div className="container">
      {blocktext.map(
        (v, i) => (
          console.log(v, i),
          (
            <div>
              <h3 className="users" className={i === 0 ? "blocks" : ""}>
                {usersNames[i]}
              </h3>
              <button class="end">+ Add a card</button>
            </div>
          )
        )
      )}
    </div>
  );
}
